  render() {
    return (
      <Body>
        <DivLogin>
          <HeaderContent>
            <h1>Sign In</h1>
          </HeaderContent>

          <form>
            <Input
              type="email"
              name="mail"
              placeholder="Enter Your Email"
              requuired
            />
            <Input
              type="password"
              name="pwd"
              placeholder="Enter Your Password"
              requuired
            />
            <Button>Sign In</Button>
          </form>
        </DivLogin>
      </Body>
    );
  }
}

export default Login;
